		<summary type="html">&lt;p style=&quot;list-style-type: circle;&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/man_1.jpg&quot; border=&quot;0&quot; style=&quot;float: left;&quot; /&gt;&lt;span style=&quot;font-size: xx-large;&quot;&gt; &lt;/span&gt;&lt;/p&gt;
&lt;table style=&quot;width: 676px; height: 80px; background-image: url(images/stories/BG-top.png);&quot; border=&quot;0&quot;&gt;
&lt;tbody&gt;
&lt;tr&gt;
&lt;td&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;Таблетка &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: xx-large;&quot;&gt;Fast Die&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; обеспечит тебе легкую &lt;/span&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;и&lt;span style=&quot;color: #339966;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;color: #339966;&quot;&gt; гарантированную&lt;/span&gt; смерть.&lt;/span&gt;&lt;/p&gt;
&lt;/td&gt;
&lt;td align=&quot;center&quot; valign=&quot;middle&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/approved.png&quot; border=&quot;0&quot; /&gt;&lt;br /&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;
&lt;/table&gt;
&lt;p&gt;&lt;span style=&quot;font-size: large;&quot;&gt;Всего одна таблетка способна остановить даже самое крепкое сердце.&lt;/span&gt;&lt;br /&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: small;&quot;&gt;- &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; сделан только из натуральных компонентов и экологически чистых материалов.&lt;br /&gt;- &lt;strong&gt;Не содержит ГМО.&lt;/strong&gt;&lt;br /&gt;- Обладает приятным вкусом (Тимур 38 лет: &lt;em&gt;«когда я съел таблетку, мне захотелось попросить добавки»&lt;/em&gt;)&lt;br /&gt;- Мгновенно всасывается в кровь и прекращает сердцебиение в течении 10-30 сек.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: small;&quot;&gt;&lt;a href=&quot;http://fast-die.kiev.ua/#Fast Die sweet dreams&quot; title=&quot;Подробнее о Fast Die Sweet Dreams&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD_sweet-dreams.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt; &lt;/span&gt;&lt;span style=&quot;font-size: small;&quot;&gt;&lt;a href=&quot;http://fast-die.kiev.ua/#Fast Die Wild Orgasm&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD_Wild-orgasm-thumb.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://fast-die.kiev.ua/#Fast Die Agony&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD_Agony-thumb.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt; &lt;br /&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;a name=&quot;Fast Die sweet dreams&quot;&gt;&lt;/a&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Хочешь уйти из жизни спокойно? &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;Мечтаешь уснуть и больше не проснуться?&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Тогда &lt;strong&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;Fast Die&lt;/span&gt;&lt;/strong&gt; sweet dreams – это то, что ты ищешь!&lt;/span&gt;&lt;br /&gt;Всего одна таблетка, и ты оставишь все свои проблемы в реальности, окунувшись в мир вечных приятных сновидений!&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;table style=&quot;background-image: url(images/stories/BG-table.png);&quot; border=&quot;0&quot;&gt;
&lt;tbody&gt;
&lt;tr&gt;
&lt;td&gt;
&lt;p&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Купить Fast Die Sweet Dreams прямо сейчас!&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD-SD-price.png&quot; border=&quot;0&quot; style=&quot;float: left;&quot; /&gt;&lt;/a&gt;&lt;/p&gt;
&lt;/td&gt;
&lt;td valign=&quot;middle&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Закажи &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Sweet Dreams прямо сейчас&lt;br /&gt;и получи в подарок  &lt;strong&gt;дисконтную карту 20%&lt;/strong&gt; на все товары производителя!&lt;br /&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Оформить заказ на Fast Die Sweet Dreams прямо сейчас!&quot;&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;Сделать заказ&lt;/strong&gt;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;
&lt;/table&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;a name=&quot;Fast Die Wild Orgasm&quot;&gt;&lt;/a&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Хочешь умереть с удовольствием? &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Мечтаешь оборвать жизнь в апогее позитивных эмоций?&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Тогда &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Wild Orgasm – это твой выбор! &lt;/span&gt;&lt;br /&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Wild Orgasm – это возможность уйти из жизни на пике сексуального возбуждения. Таблетка вызывает наступление сильнейшего оргазма, в результате которого человек умирает от разрыва сердца.&lt;br /&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/oldman-01.jpg&quot; border=&quot;0&quot; style=&quot;float: left;&quot; /&gt;Анатолий Тимофеевич 67 лет: &lt;em&gt;&lt;br /&gt;«после приема &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Wild Orgasm я испытал не только обычный оргазм, но и анальный, оральный, и  даже вагинальный.  &lt;br /&gt;Я ушел из жизни с удовольствием»&lt;br /&gt;&lt;/em&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;table style=&quot;background-image: url(images/stories/BG-table.png);&quot; border=&quot;0&quot;&gt;
&lt;tbody&gt;
&lt;tr&gt;
&lt;td&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Купить Fast Die Wild Orgasm прямо сейчас!&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD-WO-price.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Закажи &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Wild Orgasm прямо сейчас&lt;br /&gt;и получи &lt;strong&gt;в подарок&lt;/strong&gt; &lt;a href=&quot;http://fast-die.kiev.ua/news/18-just-do-it.html&quot;&gt;футболку&lt;/a&gt; с логотипом производителя.&lt;br /&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Оформить заказ на Fast Die Wild Orgasm прямо сейчас!&quot;&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;Сделать заказ&lt;/strong&gt;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;
&lt;/table&gt;
&lt;p&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;&lt;a name=&quot;Fast Die Agony&quot;&gt;&lt;/a&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Ты серийный убийца? Насильник детей?&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Злостный неплательщик налогов?&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Ты считаешь, что должен поплатиться за свои грехи сполна?&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;Или ты просто мазохист и мучения доставляют тебе удовольствие?&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Тогда &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Agony и &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Agony&lt;span style=&quot;font-size: small;&quot;&gt;&lt;sup&gt;Extra Plus&lt;/sup&gt;&lt;/span&gt; –  то, что тебе нужно!&lt;/span&gt;&lt;br /&gt;Мы гарантируем, что прежде чем умереть, ты испытаешь нечеловеческие мучения и адскую боль.&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;table style=&quot;background-image: url(images/stories/BG-table.png);&quot; border=&quot;0&quot;&gt;
&lt;tbody&gt;
&lt;tr&gt;
&lt;td&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Купить Fast Die Agony прямо сейчас!&quot;&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/FD-agony-price.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Закажи вторую таблетку &lt;/span&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Agony &lt;/span&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;для друга и получи &lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Extra Plus в подарок!&lt;br /&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Оформить заказ на Fast Die Agony прямо сейчас!&quot;&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;Сделать заказ&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;br /&gt;&lt;/strong&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;
&lt;/table&gt;
&lt;p&gt;&lt;span style=&quot;font-size: large;&quot;&gt;&lt;span style=&quot;color: #008000;&quot;&gt;Смотри так же новинки:&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/dent.png&quot; border=&quot;0&quot; style=&quot;float: left;&quot; /&gt;&lt;br /&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Agony Dent&lt;br /&gt;с эффектом смерти на приеме у стоматолога&lt;br /&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Оформить заказ на Fast Die Agony Dent прямо сейчас!&quot;&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Заказать сейчас&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/a&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;&lt;img src=&quot;http://fast-die.kiev.ua/images/stories/balls.png&quot; border=&quot;0&quot; style=&quot;float: left;&quot; /&gt;&lt;br /&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; Agony Kick In Balls&lt;br /&gt;с эффектом смерти от удара в пах&lt;br /&gt;&lt;a href=&quot;http://fast-die.kiev.ua/buy-fast-die.html&quot; title=&quot;Оформить заказ на Fast Die Agony Kick In Balls прямо сейчас!&quot;&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Заказать сейчас&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;&lt;a name=&quot;Organisations&quot;&gt;&lt;/a&gt;Продукция &lt;span style=&quot;color: #609ec3;&quot;&gt;&lt;strong&gt;Fast Die&lt;/strong&gt;&lt;/span&gt; доступна каждому!&lt;br /&gt; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: large;&quot;&gt;&lt;span style=&quot;color: #008000;&quot;&gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;&lt;span style=&quot;color: #888888;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Не достаточно денег? Не проблема!&lt;/span&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: small;&quot;&gt;Займи у друга или оформи кредит &lt;/span&gt;&lt;span style=&quot;font-size: small;&quot;&gt;в любом банке страны! А лучше, просто предоставь нам свой паспорт, и наши специалисты, за символический процент,&lt;strong&gt; сделают все это за тебя!&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: large;&quot;&gt;&lt;span style=&quot;color: #008000;&quot;&gt;&lt;span style=&quot;color: #888888;&quot;&gt; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: large;&quot;&gt;&lt;span style=&quot;color: #008000;&quot;&gt;&lt;span style=&quot;color: #888888;&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;color: #3d6896;&quot;&gt;&lt;span style=&quot;font-size: x-large;&quot;&gt;Организациям:&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
